import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function PerformanceChart({ data }) {
    // Veriyi ReCharts için uygun formata dönüştür
    const timeData = [
        {
            name: 'Sıralı Algoritma',
            sequential: data.sequential.time,
            parallel: 0,
            improved: 0,
            blocked: 0
        },
        {
            name: 'Temel Paralel',
            sequential: 0,
            parallel: data.parallel.time,
            improved: 0,
            blocked: 0
        },
        {
            name: 'Geliştirilmiş Paralel',
            sequential: 0,
            parallel: 0,
            improved: data.improved.time,
            blocked: 0
        },
        {
            name: 'Block-Based',
            sequential: 0,
            parallel: 0,
            improved: 0,
            blocked: data.blocked.time
        }
    ];

    const speedupData = [
        {
            name: 'Sıralı Algoritma',
            sequential: data.sequential.speedup,
            parallel: 0,
            improved: 0,
            blocked: 0
        },
        {
            name: 'Temel Paralel',
            sequential: 0,
            parallel: data.parallel.speedup,
            improved: 0,
            blocked: 0
        },
        {
            name: 'Geliştirilmiş Paralel',
            sequential: 0,
            parallel: 0,
            improved: data.improved.speedup,
            blocked: 0
        },
        {
            name: 'Block-Based',
            sequential: 0,
            parallel: 0,
            improved: 0,
            blocked: data.blocked.speedup
        }
    ];

    return (
        <div className="chart-wrapper">
            <h5 className="text-center mb-3">Çalışma Süresi Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={timeData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Çalışma Süresi (sn)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(6)} />
                    <Legend />
                    <Bar dataKey="sequential" fill="#3498db" name="Sıralı Algoritma" />
                    <Bar dataKey="parallel" fill="#e74c3c" name="Temel Paralel" />
                    <Bar dataKey="improved" fill="#2ecc71" name="Geliştirilmiş Paralel" />
                    <Bar dataKey="blocked" fill="#f1c40f" name="Block-Based" />
                </BarChart>
            </ResponsiveContainer>

            <h5 className="text-center mb-3 mt-5">Hızlanma (Speedup) Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={speedupData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Hızlanma (Speedup)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(2)} />
                    <Legend />
                    <Bar dataKey="sequential" fill="#3498db" name="Sıralı Algoritma" />
                    <Bar dataKey="parallel" fill="#e74c3c" name="Temel Paralel" />
                    <Bar dataKey="improved" fill="#2ecc71" name="Geliştirilmiş Paralel" />
                    <Bar dataKey="blocked" fill="#f1c40f" name="Block-Based" />
                </BarChart>
            </ResponsiveContainer>
        </div>
    );
}

export default PerformanceChart;
